syntax = "proto3";
package cn.rapidtsdb.tsdb.model.proto;
import "TSDataMessage.proto";

message ProtoCommonResponse {
  int32 code = 1;
  string msg = 2;
  int32 reqId = 3;
}


message ProtoDataResponse {
  string aggregator = 1;
  string downsampler = 2;
  ProtoDatapoints dps = 3;
  int32 reqId = 4;
}